description:
Mrs. Robinson, you're trying to seduce me. Are not you? Ben Braddock is A little Concerned About His future. He loves Elaine, but just screwed her mother. He must choose. In this true parody, Paul Thomas takes you into the lives of the newly graduated Ben, his affairs with Mrs. Robinson and her daughter Elaine.

